@91PSRuaDhdeBXfS @Theskys25675511 疫情给西方发达经济的印象比对中国的印象小。

中国是世界的工厂，GDP的一大组成部分是出口货物。

上海封城之后所有轻工业工厂全部停工，航班全部取消。不是经济不好，是经济都没有了！！

